import React,{useEffect,useState} from "react";
import Navbar from "./components/Navbar";
import Movie from './components/Movie'
import Login from "./views/Login";
import Register from './views/Register'
import { render } from "@testing-library/react";

const movie_api= "https://api.themoviedb.org/3/discover/movie?sort_by=popularity.desc&api_key=7d12b72621ac9b497306428405cfb59d";
const search_api="https://api.themoviedb.org/3/search/movie?&api_key=7d12b72621ac9b497306428405cfb59d";
function App(){
  const [movies, setMovies]= useState([]);

  useEffect(()=>{
    fetch(movie_api) 
    .then((res)=>res.json())
      .then((data) =>{ 
        console.log(data);
        setMovies(data.results);
    });
  },[]);
  render()
    return (
      <div className="container">
        {movies.length >0 && movies.map((movie) => 
          <Movie key={movie.id} {...movie}/>)}

          <Navbar />
          <div className='container'>
              <Routes>
                  <Route path="/" element={<Home name={this.state.name} incrementTotalCount={this.incrementTotalCount} count={this.state.count} changeName={this.changeName} />} />
                  <Route path="Login" element={<Login />} />
                  <Route path="kekambas" element={<Kekambas />} />
              </Routes>

          </div></div>

    );
}
export default App;
